import React from "react";
import { Map, TileLayer } from "react-leaflet-universal";
import { Icon } from "leaflet";

function MapIp({ cordinates }) {
  const position = [cordinates?.lat, cordinates?.lng];

  return (
    <div className="h-64 w">
      <Map center={[45.4, -75.7]} zoom={12} leafletRef={ref}>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        />
      </Map>
    </div>
  );
}

export default MapIp;
